function App() {
  const name = "João"
  const newName = name.toUpperCase()

  function sum(a,b){
    return a + b
  }

  return (
    <div className="App">
      <h>Olá Mundo</h>
      <p>Olá, {newName}.</p> 
      <p>A soma é {sum(1,8)}</p>
    </div>
  );
}

export default App;
